var __STORY__ = "import React, { useState } from 'react'\nimport { number, boolean } from '@storybook/addon-knobs'\nimport { SingleSlider, RangeSlider } from '@titicaca/slider'\nimport { Text } from '@titicaca/core-elements'\n\nfunction SingleLabel({ value }: { value: number }) {\n  return <Text size=\"large\">컴포넌트 내부: {value}</Text>\n}\n\nfunction RangeLabel({\n  fromValue,\n  toValue,\n}: {\n  fromValue: number\n  toValue: number\n}) {\n  return (\n    <Text size=\"large\">\n      컴포넌트 내부: {fromValue} ~ {toValue}\n    </Text>\n  )\n}\n\nexport default {\n  title: 'slider | Slider',\n}\n\nexport function BaseSingleSlider() {\n  const [value, setValue] = useState(500000)\n\n  return (\n    <div>\n      컴포넌트 외부: {value}\n      <SingleSlider\n        initialValue={value}\n        min={0}\n        max={500000}\n        onChange={setValue}\n        labelComponent={SingleLabel}\n        debounceTime={number('debounceTime', 800)}\n        nonLinear={boolean('nonLinear', false)}\n      />\n    </div>\n  )\n}\n\nBaseSingleSlider.story = {\n  name: 'SingleSlider',\n}\n\nexport function BaseRangeSlider() {\n  const [values, setValues] = useState([0, 500000])\n  return (\n    <div>\n      컴포넌트 외부: {values.join(', ')}\n      <RangeSlider\n        initialValues={values}\n        min={0}\n        max={500000}\n        onChange={([form, to]) => {\n          setValues([form, to])\n        }}\n        labelComponent={RangeLabel}\n        debounceTime={number('debounceTime', 800)}\n        nonLinear={boolean('nonLinear', false)}\n      />\n    </div>\n  )\n}\n\nBaseRangeSlider.story = {\n  name: 'RangeSlider',\n}\n\nexport function AdjustedRangeSlider() {\n  const [values, setValues] = useState([1, 31])\n  return (\n    <div>\n      컴포넌트 외부: {values.join(', ')}\n      <RangeSlider\n        initialValues={values}\n        min={1}\n        max={31}\n        step={3}\n        onChange={([form, to]) => {\n          setValues([form, to])\n        }}\n        adjustInitValues\n        labelComponent={RangeLabel}\n        debounceTime={number('debounceTime', 800)}\n        nonLinear={boolean('nonLinear', false)}\n      />\n    </div>\n  )\n}\n\nAdjustedRangeSlider.story = {\n  name: 'AdjustedRangeSlider',\n}\n"; // @ts-ignore

